      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 IN ( CAST ( NULL AS REAL ) / 46 + ( CAST ( - 12 AS INTEGER ) + col1 ) );
  - name: tab1

outputs:
  - name: q9515.out
    data: |
